import { getData } from "../lib/data";

export default function Home({ allData }) {
  return (
    <section>
      <div>
        {allData.map(({ Title, Author, id }) => (
          <div key={id}>
            {Title}
            {Author}
          </div>
        ))}
      </div>
    </section>
  );
}

export async function getStaticProps() {
  const allData = getData();
  return {
    props: {
      allData
    }
  };
}
